"""## Оптическое распознавание символов **(OCR)**

Оптическое распознавание символов (OCR) — перевод изображений машинописного, рукописного или печатного текста в электронные текстовые данные. Обработка данных при помощи OCR может применяться для самых различных задач:

1.    Извлечение данных и перенос в электронные базы данных банковских, бухгалтерских, юридических документов.
2.    Сканирование печатных документов с последующей возможностью редактирования.
3.    Перенос исторических документов и книг в архивы.
4.    Распределение печатного материала по темам.
5.    Индексирование и поиск отсканированного печатного материала.

В настоящее время все больше организаций переходят от бумажной формы документооборота к электронной. И перед разработчиками ИИ стоит задача, обеспечить эти организации качественным программным обеспечением, с высоким уровнем распознавания.
"""

#@title Необходимые функции
