import easyocr
import cv2
import matplotlib.pyplot as plt

def easyOCR(img):
  img = cv2.imread(img)
  plt.figure(figsize=(10, 6))
  plt.imshow(cv2.cvtColor(img, cv2.COLOR_BGR2RGB))
  plt.axis('off')
  plt.show()
  reader = easyocr.Reader(['ru'])
  txt = reader.readtext(img, detail=0, paragraph=True)
  print(txt)

